/*
 * @Author: EmberCCC 1810888456@qq.com
 * @Date: 2022-07-01 20:45:23
 * @LastEditors: EmberCCC 1810888456@qq.com
 * @LastEditTime: 2022-07-02 13:37:58
 * @FilePath: \bl-device-manage-test\src\layouts\FormEdit\index.js
 * @Description: 这是默认设置,请设置`customMade`, 打开koroFileHeader查看配置 进行设置: https://github.com/OBKoro1/koro1FileHeader/wiki/%E9%85%8D%E7%BD%AE
 */
import { defaultGlobalSetting, defaultSettings } from 'constants/field_config';
import Generator from 'fr-generator';
import React, { useEffect, useRef } from 'react';
import './index.css'


const FormEdit = () => {
  const ref = useRef();

  const goToFrPlayground = () => {
    ref.current.copyValue();
    window.open('/playground');
  };

  return (
    <div className="fr-generator-playground" style={{ height: '80vh' }}>
      <Generator
        ref={ref}
        settings={defaultSettings}
        commonSettings={defaultGlobalSetting}
        extraButtons={[{ text: '去playground验证', onClick: goToFrPlayground }]}
      />
    </div>
  );
};

export default FormEdit;
